import React, { Component } from 'react'
import { connect } from 'react-redux'
//import the reducer that contains the songList
//import songListReducer from '../reducers/song_list_reducer'

class SongList extends Component {

  render() {
    const songs = this.props.songList.map(song => {
      return (
        <div key={song.title}>
          <div>{song.title}</div>
          <div>{song.artist}</div>
          <div>{song.length} mins</div>
        </div>
      )
    })
    return (
      <h4>SongList</h4>
    )
  }
}

function mapStateToProps(state) {
  //here the state will go into this.props....
  console.log('state', state)
  return {
    songList: state.songList
  }
}

export default connect(mapStateToProps)(SongList)
